import React from "react";
import Articls from "./Articls";

let articles=[
    {
        img:"url",
        nmb:"01",
        titre:"toto",
        sousTitre:"lorem ipsome blabla"
    }
]

function Footer(){
    return(
        <>
            {articles.map((article, index) =>(

                <Articls 
                    key={index}
                    img={article.img}
                    nmb={article.nmb}
                    titre={article.titre}
                    sousTitre={article.sousTitre}
                />
            ))}
        </>
    )
}

export default Footer;
